import React, { Component } from 'react';
import './Dice.css';
import '..'

class Dice extends Component {
    render() {
        return (
            <div className="diceIcon">
                <div id = "newGameBtn"><i></i>New Game</div>

                <img className="dice1"></img>

                <img src="public/images/dice-1.png" className="dice2"></img>

                <div id = "rollDice"><i></i>roll dice</div>

                <div id = "holdIcon"><i></i>hold</div>

                <input id="inputScore"></input>
            </div>
        );
    }
}

export default Dice;
